import { useState } from 'react'

export default function Pokemon({ pokemon, prev, next }) {

  return (
    <div>
      <div>
        <button onClick={prev()}>Previous</button>
        <button onClick={next()}>Next</button>
      </div>
        {pokemon.map(p => (
            <div id={p}>{p}</div>
        ))}
    </div>
  )
}
